import React from 'react';
import Header from './components/Header';
import Nav from './components/Nav';
import Main from './components/Main';
import Footer from './components/Footer';
import Hero from './components/Hero/Hero';
import './App.css';

function App() {
  return (
    <div className="App">
      <h1>Hello</h1>
      <Header />
      <Hero />
      <Nav />
      <Main />
      <Footer />
    </div>
  );
}

export default App;
